import { faTrashAlt } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React from 'react';
import { Button, Container, Table } from 'react-bootstrap';
import './style.css';

type Props = {};
type State = {};

export default class ShoppingCartPage extends React.Component<Props, State> {
    render() {
        return(
        <Container>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>Image</th>
                        <th>ProductName</th>
                        <th>Price</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td><img className="cartImg" src="https://nitrosnowboards.com/sites/default/files/styles/variant_photos_protrait_no_crop_xl/public/2020-07/21-cannon-203.png.webp?itok=PtJl1ntI"/></td>
                        <td>Nitro Canon</td>
                        <td>$4500</td>
                        <td><Button variant="danger"><FontAwesomeIcon icon={faTrashAlt}/>Danger</Button></td>
                    </tr>
                </tbody>
                <tbody>
                    <tr>
                        <td><img className="cartImg" src="https://nitrosnowboards.com/sites/default/files/styles/variant_photos_protrait_no_crop_xl/public/2020-07/21-cannon-203.png.webp?itok=PtJl1ntI"/></td>
                        <td>Nitro Canon</td>
                        <td>$4500</td>
                        <td><Button variant="danger">Danger</Button> <Button variant="info">Info</Button>{' '}</td>
                    </tr>
                </tbody>
            </Table>
        </Container>
        )
    }
}
